    false,nt"url": null,nt"notes": "Minnesota Valley National Wildlife Refuge
    (NWR) contains a limited fishery resource. Hogback Ponds, Round Lake, Bituminous
    Pond, and Blick Estate Stream have fishery management potential, however, all these
    systems are small. Black Dog Lake and the Minnesota River contain a diverse fish
    population, however, these fish have consumption advisories placed on them. The
    Refuge also contains several shallow backwater lakes that are prone to winter kills.
    Discussions have been conducted with the Refuge Manager concerning: 1) chemical
    renovations of Little Hogback Pond; 2) increasing and improving bank fishing areas;
    3) stocking largemouth bass and bluegill to provide a more desirable fishery; and
    4) conducting fishery surveys on Bituminous Pond and Blick Estate Stream. This report
    provides objectives and recommendations which are intended to improve the fishery
    resources and enhance quality fishing opportunities.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
